import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';
import Home2 from './components/Home2';
import About2 from './components/About2';
import Contact2 from './components/Contact2';

import './styles/base.scss';

const logo = require('./images/sass_logo.png');//for reusability

class App extends Component {
  render() {
    return (
    <Router>
      <div>
        {/* <h1>Welcome to React Router Tutorial</h1> */}
        <nav className="navbar navbar-expand-lg navbar-dark bg-transparent fixed-top">
        <div className="container-fluid">
        <a className="navbar-brand" href="#">
          <img src={logo} className="logo"/>
        </a>
        <ul className="navbar-nav ml-auto">
            <li className="nav-item"><Link exact to={'/'} className="nav-link current"> HOME </Link></li>
            <li className="nav-item"><Link exact to={'/contact'} className="nav-link current">CONTACT</Link></li>
            <li className="nav-item"><Link exact to={'/about'} className="nav-link current">ABOUT</Link></li>
          </ul>
        </div>
        </nav>
        <hr />
          <Switch>
              <Route exact path='/' component={Home2} />
              <Route path='/contact' component={Contact2} />
              <Route path='/about' component={About2} />
          </Switch>
      </div>
    </Router>
    );
  }
}

export default App;
